db.payers.aggregate([
    {
        $match: { "_id": ObjectId("d18ef2e6-ef40-324c-be54-34a5ee865625") }
    },
    {
        $unwind: "$PAYER_BENEFITS" 
    },
    {
        $unwind: "$PAYER_BENEFITS.COVERED_SERVICES" 
    },
    {
        $lookup: {
            from: "services",
            localField: "PAYER_BENEFITS.COVERED_SERVICES.service_code",
            foreignField: "SERVICE_CODE",
            as: "SERVICE"
        }
    },
    {
        $unwind: "$SERVICE"
    },
    {
        $unwind: "$SERVICE.ENCOUNTERS" 
    },
    {
        $group: {
            _id: "$SERVICE.ENCOUNTERS.PATIENT_ID",
            count: { $sum: 1 }
        }
    },
    {
        $project: {
            _id: 0,
            patient_encounter_count: "$count",
            patient_id: "$_id"
        }
    }
])

