db.patients.aggregate([
  {
    $match: {
      ENCOUNTERS: {
        $elemMatch: {
          ENCOUNTER_ID: "dc18f2e5-1513-a786-fb8f-90fdb43d759e"
        }
      }
    }
  },
  {
    $unwind: "$ENCOUNTERS"
  },
  {
    $match: {
      ENCOUNTERS: {
        $elemMatch: {
          ENCOUNTER_ID: "dc18f2e5-1513-a786-fb8f-90fdb43d759e"
        }
      }
    }
  },
  {
    $lookup: {
      from: "providers",
      localField: "ENCOUNTERS.PROVIDER_ID",
      foreignField: "PROVIDER_ID",
      as: "provider"
    }
  },
  {
    $unwind: {
      path: "$provider",
      preserveNullAndEmptyArrays: true
    }
  },
  {
    $project: {
      _id: 0,
      PROVIDER_NAME: "$provider.PROVIDER_NAME",
      ENCOUNTER_ID: "$ENCOUNTERS.ENCOUNTER_ID"
    }
  }
])

